import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  const clickStyle = { color: 'red' };

  const scrollToSection = (sectionId) => {
    console.log(`Scrolling to section with ID: ${sectionId}`);
    const section = document.getElementById(sectionId);
    console.log('Section element:', section);
    if (section) {
      section.scrollIntoView({
        behavior: 'smooth',
      });
    } else {
      console.log('Section element not found.');
    }
  };
  

  return (
    <header>
      <meta
        name="viewport"
        content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=0"
      />
      <link
        rel="stylesheet"
        href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css"
      />
      <div className="inner">
        <h1 className="logo">
          <Link exact to="/react_portfolio">
            Branden Min
          </Link>
        </h1>
        <ul className="gnb">
          <li>
            <button onClick={() => scrollToSection('headline')}>About</button>
          </li>
          <li>
            <button onClick={() => scrollToSection('projects')}>PROJECTS</button>
          </li>
          <li>
            <button onClick={() => scrollToSection('experiences')}>EXPERIENCES</button>
          </li>
          <li>
            <button onClick={() => scrollToSection('skills')}>SKILLS</button>
          </li>
          <li>
            <Link onClick={() => window.open('/react_portfolio/BrandenMin.pdf', '_black')} to="/Cv">
              CV
            </Link>
          </li>
        </ul>
        <div className="snsContact">
          <a href="https://www.linkedin.com/in/brandenmin/" target="_blank">
            <i className="fa-brands fa-linkedin"></i>
          </a>
          <a href="https://github.com/Gemnnn" target="_blank">
            <i className="fa-brands fa-github"></i>
          </a>
          <a href="#">
            <i className="fa-brands fa-facebook"></i>
          </a>
        </div>
      </div>
    </header>
  );
}

export default Header;
